def distAtFractionOfSky(fractionOfSky,Rp):
    #fractionOfSky is the fraction of Sky the planet takes up in the spacecraft's view
    #Rp is the radius of the planet
    solidAngle = fractionOfSky*4*np.pi#4pi is the total solid angle of a sphere
    Angle = np.arccos(1-solidAngle/(2*np.pi))#Cone Angle when SC sees fractionOfSky
    Dist = Rp/np.tan(Angle) - Rp
    return Dist

def plotSolarSystemTrajectory(X,Y,Z,Rp,body_name):
    plt3d_tmp = figure().gca(projection='3d')
    ax2 = gca()
    ax2.plot(X,Y,Z,color='black')
    title(body_name + ': Planetary Centric Dynamic Frame')
    ax2.set_xlabel('Direction of Sun x (km)')
    ax2.set_ylabel('y (km)')
    ax2.set_zlabel('Out Of Ecliptic z (km)       ')
    show(block=False)

def parseTrajectoryCloseToBody(body_name,minDist,trajStruct):
    #minDist - distance where we become conerned with the body
    #body_name - body name consistent with trajStruct naming conventions for bodies
    #trajStruct - trajectory data structur containing positions of all bodies of concern
    trajBodyNames = [name['Body'] for name in trajStruct['Body Ephemeris']]
    bodyInd = trajBodyNames.index(body_name.capitalize())#Capitalize converts string into first char capitol form
    posBody = np.array(trajStruct['Body Ephemeris'][bodyInd]['Position'])
    velBody = np.array(trajStruct['Body Ephemeris'][bodyInd]['Velocity'])
    attBody = np.array(trajStruct['Body Ephemeris'][bodyInd]['Orientation'])

    sunInd = trajBodyNames.index('Sun'.capitalize())
    posSun = np.array(trajStruct['Body Ephemeris'][sunInd]['Position'])
    velSun = np.array(trajStruct['Body Ephemeris'][sunInd]['Velocity'])
    attSun = np.array(trajStruct['Body Ephemeris'][sunInd]['Orientation'])

    r_body_sun = map(lambda x,y: x-y, posBody, posSun)#Calculate Earth pos w.r.t the sun.
    normr_body_sun = np.linalg.norm(r_body_sun,axis=1)

    posSC = np.array(trajStruct['Position'])
    velSC = np.array(trajStruct['Velocity'])
    #attSC = np.array(trajStruct['Control'])#

    r_sc_sun = map(lambda x,y: x-y, posSC, posSun)#Calculate SC pos w.r.t the sun.
    normr_sc_sun = np.linalg.norm(r_sc_sun,axis=1)#Calculate distance between spacecraft and sun

    r_sc_p = map(lambda x,y: x-y, r_sc_sun, r_body_sun)#Calculate SC pos w.r.t the planet.
    normr_sc_p = np.linalg.norm(r_sc_p,axis=1)#Calculate distance between spacecraft and planet
    indsToKeep = np.where(normr_sc_p<minDist)[0]

    time_sc_sun = trajStruct['Time']

    return np.asarray(r_sc_p)[indsToKeep], np.asarray(r_body_sun)[indsToKeep], np.asarray(time_sc_sun)[indsToKeep]

def rotation_matrix(axis, theta):
    """
    Return the rotation matrix associated with counterclockwise rotation about
    the given axis by theta radians.
    https://stackoverflow.com/questions/6802577/rotation-of-3d-vector
    """
    axis = np.asarray(axis)
    axis = axis / math.sqrt(np.dot(axis, axis))#normalize Axis
    a = math.cos(theta / 2.0)
    b, c, d = -axis * math.sin(theta / 2.0)
    aa, bb, cc, dd = a * a, b * b, c * c, d * d
    bc, ad, ac, ab, bd, cd = b * c, a * d, a * c, a * b, b * d, c * d
    return np.array([[aa + bb - cc - dd, 2 * (bc + ad), 2 * (bd - ac)],\
                     [2 * (bc - ad), aa + cc - bb - dd, 2 * (cd + ab)],\
                     [2 * (bd + ac), 2 * (cd - ab), aa + dd - bb - cc]])

def convertToPlanetaryCentricDynamicFrame(rotVect,angle,arrayOfStuff):
    #Purpose: To apply rotation to All Values in arrayOfStuff
    outArray = list()
    for i in np.arange(len(arrayOfStuff)):
        rmat = rotation_matrix(rotVect[i],angle[i])
        outArray.append(np.dot(rmat,arrayOfStuff[i]))
    return np.asarray(outArray)

